// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;
pragma experimental ABIEncoderV2;
import './Mia.sol';

contract Guer {

    address docId;
    mapping(address => address[]) MiasByUser;
    address payable ourWallet;
    constructor() payable {
        ourWallet = msg.sender;
    }

    function getGuerOwnerAddress() public view returns(address){
        return ourWallet;
    }

    function doPayRoyalty() public payable returns(bool){
        //if (msg.value >= .001 ether)
        //{
        //    ourWallet.transfer(msg.value);
        //    return true;
        //}
        //else {
        //    return false;
        //}
    }

    function updateUserProfile(address payable docAddress, bytes32 _name, bytes32 _email, bytes32 _mobile, bytes memory _image) public payable {
        Mia(docAddress).updateUserProfile(_name,_email, _mobile, _image);
    }

    function createNFT(bytes32 _name, bytes32 _email, bytes32 _mobile, bytes memory _image) public payable {
        Mia a = new Mia(_name, _email, _mobile, _image);
        MiasByUser[msg.sender].push(address(a));
    }

    function getUserNFTs() public view returns (address[] memory){
        return MiasByUser[msg.sender];
    }

    function getNFTInfo(address payable docAddress) public view returns (address, bytes32, bytes32, bytes32, bytes memory, uint, address[] memory, address[] memory, uint){
        return Mia(docAddress).getMia();
    }

    function doGetPhotoCount(address payable docAddress) public view returns (uint) {
        return Mia(docAddress).getPhotoCount();
    }

    function doGetPhoto(address payable docAddress, uint _id) public view returns (string memory, string memory, uint, string memory) {
        return Mia(docAddress).getPhotoDetails(_id);
    }

    function doAddPhoto(address payable docAddress, string memory _location, string memory _name, string memory _filetype) public {
        Mia(docAddress).addPhoto(_location, _name, _filetype);
    }

    function doRemovePhoto(address payable docAddress, uint _id) public {
        Mia(docAddress).removePhoto(_id);
    }

    function doAddMessage(address payable docAddress, address _partner, string memory _location, string memory _key) public {
        return Mia(docAddress).addMessage(_partner,_location,_key);
    }

    function doGetMessages(address payable docAddress, address _partner) public view returns (string memory, string memory) {
        return Mia(docAddress).getMessages(_partner);
    }

    function doRemoveUserFromMiaAddressBook(address payable docAddress, address _userAddress) public {
        Mia(docAddress).removeAddressFromBook(_userAddress);
    }

    function doAddUserToMiaAddressBook(address payable docAddress, address _otherAccount, bytes32 _name, bool _coowner) public {
        Mia(docAddress).addAddressToBook(_otherAccount, _name, _coowner);
    }

    function doTransferFunds(address payable docAddress, address payable _receiver, uint256 _amount) public payable {
        Mia(docAddress).transferFunds(_receiver, _amount);
    }

    function doGetContactInfo(address payable docAddress, address _otherAccount) public view returns (address,bytes32,bool) {
        return Mia(docAddress).getContactInfo(_otherAccount);
    }

    function getNFTUserPhotoAccess(address payable docAddress, address _userAddress) public view returns (bool){
        return Mia(docAddress).getIsPhotoAccess(_userAddress);
    }

    function getNFTUserGeneralAccess(address payable docAddress, address _userAddress) public view returns (bool){
        return Mia(docAddress).getIsGeneralAccess(_userAddress);
    }

    function getNFTUserPersonalAccess(address payable docAddress, address _userAddress) public view returns (bool){
        return Mia(docAddress).getIsPersonalAccess(_userAddress);
    }

    function getNFTUserPermissions(address payable docAddress, address _userAddress) public view returns (bytes[] memory){
        return Mia(docAddress).getUserPermissions(_userAddress);
    }

    function doGetMarketplaceJson(address payable docAddress) public view returns (string memory) {
        return Mia(docAddress).getMarketplaceJson();
    }

    //function doUpdateUserPermissions(address payable docAddress, address _userAddress, uint _photos, uint _general,  uint _personal) public {
    //    Mia(docAddress).updateUserPermission(_userAddress, _photos, _general, _personal);
    //}

    function doUpdateMarketplaceJson(address payable docAddress, string memory _json) public {
        Mia(docAddress).updateMarketplaceJson(_json);
    }
}
